import React from "react";
import { NavLink } from "react-router-dom"

export default function Navbar(){
    return(
        <>
          <nav id="navbar">

        <NavLink to="/" className="routelinks" id="homelink" >#VANLIFE</NavLink>

       <div id="link-right">
       <NavLink to="/host" className="routelinks" id = {({isActive}) => isActive  ? "hostroutelink-active" : null} >Host</NavLink>
        <NavLink to="/about" className="routelinks" id = {({isActive}) => isActive  ? "hostroutelink-active" : null} >About</NavLink>
        <NavLink to="/vans" className="routelinks"  id = {({isActive}) => isActive  ? "hostroutelink-active" : null}>Vans</NavLink>
        </div>

        </nav>

         </>
    )
}
